  false,\n\t\"url\": null,\n\t\"notes\": \"The 2014 cartographic boundary KMLs are
  simplified representations of selected geographic areas from the U.S. Census Bureau's
  Master Address File / Topologically Integrated Geographic Encoding and Referencing
  (MAF/TIGER) Database (MTDB). These boundary files are specifically designed for
  small-scale thematic mapping. When possible, generalization is performed with the
  intent to maintain the hierarchical relationships among geographies and to maintain
  the alignment of geographies within a file set for a given year. Geographic areas
  may not align with the same areas from another year. Some geographies are available
  as nation-based files while others are available only as state-based files.nnAfter
  each decennial census, the Census Bureau delineates urban areas that represent densely
  developed territory, encompassing residential, commercial, and other nonresidential
  urban land uses.  In general, this territory consists of areas of high population
  density and urban land use resulting in a representation of the \"urban footprint.\"
  \ There are two types of urban areas: urbanized areas (UAs) that contain 50,000
  or more people and urban clusters (UCs) that contain at least 2,500 people, but
  fewer than 50,000 people (except in the U.S. Virgin Islands and Guam which each
  contain urban clusters with populations greater than 50,000).  Each urban area is
  identified by a 5-character numeric census code that may contain leading zeroes.\",\n\t\"license_title\":
